/* enable pbuf allocation on start */
#define ALLOC_PBUF_ON_TRANSFER 0

/* local function prototypes */
void recv_callback( void *, struct udp_pcb *, struct pbuf *, struct ip_addr *, u16_t );

/* global variables for UDP data transfer */
static struct udp_pcb *connected_pcb = NULL;
static struct pbuf *pbuf_to_be_sent = NULL;
static unsigned int wm_count = 0x00000168;   /* initial watermark setting */
static short int send_bufsize;               /* send buffer size */
static unsigned int write_val = 0x00000037;  /* dummy write value */
static unsigned int rec_counter;
static Xuint32 data_left;

/******************************************************************************
* Name:        start_application
* Description: Setup buffers and configure IP / UDP
* 
* Returns:     int   - returns 0 if no errors
******************************************************************************/
int start_application() {
   
   /* udp, ip, error, port, and loop counter variables */
   struct udp_pcb *pcb;
   struct ip_addr ipaddr_dest, ipaddr_src;
   err_t err;
   u16_t port;

   /* create a udp socket */
   pcb = udp_new();
   if( !pcb ) {
      xil_printf("Error creating PCB. Out of Memory\n\r");
      return -1;
   }
   
   /* set port for source and destination */
   port = 61557;
   
   /* set the initial buffer size */
   send_bufsize = 360 * sizeof(int);/*wm_count * sizeof( int );*/
   
   /* bind local address */
   IP4_ADDR(&ipaddr_src,  192, 168,  1, 15);
   if( ( err = udp_bind( pcb, &ipaddr_src, port ) ) != ERR_OK ) {
      xil_printf("error on udp_bind: %x\n\r", err);
      return -1;
   }
   
   /* setup UDP connection to destination */
	IP4_ADDR(&ipaddr_dest,  192, 168,  1, 104);
   if( ( err = udp_connect( pcb, &ipaddr_dest, port ) ) != ERR_OK ) {
      xil_printf("error on udp_connect: %x\n\r", err);
      return -1;
   }
   xil_printf("udp_connect issued\n\r");

   /* save the connection pointer */
	connected_pcb = pcb;

   /* allocate buffer */
   #if !ALLOC_PBUF_ON_TRANSFER    
	pbuf_to_be_sent = pbuf_alloc(PBUF_RAW, send_bufsize, PBUF_POOL);
	if (!pbuf_to_be_sent) {
		xil_printf("error allocating pbuf to send\n\r");
      return -1;
   }
   xil_printf( "pbuf allocation: on start (%d bytes)\n\n\r", send_bufsize );
   #else
   xil_printf( "pbuf allocation: on transfer (%d bytes)\n\n\r", send_bufsize );
   #endif


	/* Clear the input and output counters, and sync all the filters*/ 
	QMFIR_mWriteSlaveReg0(XPAR_QMFIR_0_BASEADDR, 0, 0x80000001 );
   QMFIR_mWriteSlaveReg3(XPAR_QMFIR_0_BASEADDR, 0, wm_count << 16 );
          

   /* set up the receive callback */
   udp_recv(pcb, recv_callback, NULL);
	
	Xuint32 icnt;
	icnt = QMFIR_mReadSlaveReg2(XPAR_QMFIR_0_BASEADDR, 0);
	xil_printf("Initial icnt = %d\r\n", icnt);
	
	return 0;
   
} /* start_application */

/******************************************************************************
* Name:        transfer_data
* Description: Send out UDP data
* 
* Arguments:   unsigned int  - interrupt bits
* Returns:     int           - returns 0 if no errors
******************************************************************************/
int transfer_data( unsigned int irq_bits ) {

   /* error, udp, sine computation, and loop counter variables */
   err_t err;
   struct udp_pcb *pcb = connected_pcb;
   short int data_count;
   int data_array1[send_bufsize / sizeof(int)];
	int data_array2[send_bufsize / sizeof(int)];
	int data_array3[send_bufsize / sizeof(int)];
   int i;
	int j;
	

   if (!connected_pcb) {
      return -1;
   }
   
   /* read count from register */
   data_count = (short int)QMFIR_mReadSlaveReg3(XPAR_QMFIR_0_BASEADDR, 0);
   
   /* allocate buffer */
   #if ALLOC_PBUF_ON_TRANSFER    
   pbuf_to_be_sent = pbuf_alloc(PBUF_RAW, send_bufsize, PBUF_POOL);
   if (!pbuf_to_be_sent) {
      xil_printf("error allocating pbuf to send\n\r");
      return -1;
   }
   #endif

   /* copy data to payload area */
   #ifdef DATA_DUMP
   for( i = 0; i < send_bufsize / sizeof(Xuint32); i++ ) {
      data_array1[i] = QMFIR_mReadMemory(XPAR_QMFIR_0_MEM0_BASEADDR+(i)*sizeof(Xuint32));
//      xil_printf("BRAM read address 0x%08x is data 0x%08x...\n\r", XPAR_QMFIR_0_MEM0_BASEADDR+i*4, QMFIR_mReadMemory(XPAR_QMFIR_0_MEM0_BASEADDR+i*4));    
   }
//	usleep(100000);
//	for (i=0; i < 50000000; i++) {
//		i = i + 1;
//		}
   memcpy(pbuf_to_be_sent->payload, data_array1, send_bufsize);   
   #else
   memcpy(pbuf_to_be_sent->payload, (Xuint32 *)(XPAR_QMFIR_0_MEM0_BASEADDR), send_bufsize);  
   #endif
   
   /* set payload size */
   pbuf_to_be_sent->len = send_bufsize;
   
   if (!pbuf_to_be_sent) {
      return -1;
   }

   /* send UDP and check for errors */
   if( ( err = udp_send( pcb, pbuf_to_be_sent ) ) != ERR_OK ) {
      xil_printf("Error on udp_send: %d\n\r", err);
      return -1;
   }
      
   /* deallocate pbuf */
   #if ALLOC_PBUF_ON_TRANSFER
   pbuf_free( pbuf_to_be_sent );
   #endif
   
   /* reset the receive counter and compute how much data is left in BRAM */
   rec_counter = 0;
   data_left = data_count - wm_count;
	xil_printf("1st data sent\n\r");
	
	/* copy data to payload area */
   #ifdef DATA_DUMP
   for( i = 0; i < send_bufsize / sizeof(Xuint32); i++ ) {
      data_array2[i] = QMFIR_mReadMemory(XPAR_QMFIR_0_MEM2_BASEADDR+(i)*sizeof(Xuint32));
  //    xil_printf("BRAM read address 0x%08x is data 0x%08x...\n\r", XPAR_QMFIR_0_MEM2_BASEADDR+i*4, QMFIR_mReadMemory(XPAR_QMFIR_0_MEM2_BASEADDR+i*4));    
   }
//	usleep(100000);
   memcpy(pbuf_to_be_sent->payload, data_array2, send_bufsize);   
   #else
   memcpy(pbuf_to_be_sent->payload, (Xuint32 *)(XPAR_QMFIR_0_MEM2_BASEADDR), send_bufsize);  
   #endif
   
   /* set payload size */
   pbuf_to_be_sent->len = send_bufsize;
   
   if (!pbuf_to_be_sent) {
      return -1;
   }

   /* send UDP and check for errors */
   if( ( err = udp_send( pcb, pbuf_to_be_sent ) ) != ERR_OK ) {
      xil_printf("Error on udp_send: %d\n\r", err);
      return -1;
   }
      
   /* deallocate pbuf */
   #if ALLOC_PBUF_ON_TRANSFER
   pbuf_free( pbuf_to_be_sent );
   #endif
   
   /* reset the receive counter and compute how much data is left in BRAM */
   rec_counter = 0;
   data_left = data_count - wm_count;
	xil_printf("2nd data sent\n\r");
	
	/* copy data to payload area */
   #ifdef DATA_DUMP
   for( i = 0; i < send_bufsize / sizeof(Xuint32); i++ ) {
      data_array3[i] = QMFIR_mReadMemory(XPAR_QMFIR_0_MEM1_BASEADDR+(i)*sizeof(Xuint32));
 //     xil_printf("BRAM read address 0x%08x is data 0x%08x...\n\r", XPAR_QMFIR_0_MEM1_BASEADDR+i*4, QMFIR_mReadMemory(XPAR_QMFIR_0_MEM1_BASEADDR+i*4));    
 //     xil_printf(".\n\r");
	}
//	usleep(100000);
   memcpy(pbuf_to_be_sent->payload, data_array3, send_bufsize);   
   #else
   memcpy(pbuf_to_be_sent->payload, (Xuint32 *)(XPAR_QMFIR_0_MEM1_BASEADDR), send_bufsize);  
   #endif
   
   /* set payload size */
   pbuf_to_be_sent->len = send_bufsize;
   
   if (!pbuf_to_be_sent) {
      return -1;
   }

   /* send UDP and check for errors */
   if( ( err = udp_send( pcb, pbuf_to_be_sent ) ) != ERR_OK ) {
      xil_printf("Error on udp_send: %d\n\r", err);
      return -1;
   }
      
   /* deallocate pbuf */
   #if ALLOC_PBUF_ON_TRANSFER
   pbuf_free( pbuf_to_be_sent );
   #endif
   
   /* reset the receive counter and compute how much data is left in BRAM */
   rec_counter = 0;
   data_left = data_count - wm_count;
	xil_printf("3rd data sent\n\r");
	
   
   /* clear the corresponding interrupt - save residual counter value */   
   QMFIR_mWriteSlaveReg3(XPAR_QMFIR_0_BASEADDR, 0, (wm_count << 16) + data_left );
   if( data_left < wm_count ) {
      QMFIR_mWriteSlaveReg0(XPAR_QMFIR_0_BASEADDR, 0, 0x00000002 );
   }
	
	/* Clear the input and output counters, and sync all the filters*/ 
	  QMFIR_mWriteSlaveReg0(XPAR_QMFIR_0_BASEADDR, 0, 0x80000001 );
     QMFIR_mWriteSlaveReg3(XPAR_QMFIR_0_BASEADDR, 0, wm_count << 16 );
          

   xil_printf( "\n\rIRQ %d: sending %d bytes, %d points left in BRAM\n\r", irq_bits, send_bufsize, data_left );
	QMFIR_mWriteSlaveReg2(XPAR_QMFIR_0_BASEADDR, 0, 0x00000000);	//reset ICNT
	return 0;

} /* transfer_data */

