/******************************************************************************
* Name:        recv_callback
* Description: Receive UDP data
* 
* Arguments:   standard receive callback arguments
******************************************************************************/
void recv_callback( void *arg, struct udp_pcb *upcb,struct pbuf *p, struct ip_addr *addr, u16_t port ) {

   u16_t len = p->len / sizeof(Xuint32);
   Xuint32 *data = (Xuint32*) p->payload;
   int i;
   
   /* update receive counter */
   rec_counter += len;
   
   //#ifdef DATA_DUMP
   //xil_printf("   Received %d points, TOTAL: %d\n\r", len, rec_counter + data_left * 50 );
   //#endif
   
   for( i = 0; i < len; i++ ) {
      /* xil_printf("data[%d] = %d\n\r", i, *(Xuint32 *)(data + i)); */
      QMFIR_mWriteToFIFO( XPAR_QMFIR_0_BASEADDR, 0, *(Xuint32 *)(data + i) );
   }
	rec_counter = 0;
	len = 0;
	data_left = 0;
   /* free the receive pbuf */
   pbuf_free(p);
	
	xil_printf("new data arrived\r\n");
	Xuint32 icnt;
	icnt = QMFIR_mReadSlaveReg2(XPAR_QMFIR_0_BASEADDR, 0);
	xil_printf("icnt = %d\r\n", icnt);
   
} /* recv_callback */
